How can I perform a graphLookUp excluding null connections?<p>I need to perform a graphLookUp on a nullable field. In this example, I have a collection of &quot;nodes&quot; where both &quot;name&quot; and &quot;connectsTo&quot; may be null, but if they are both null, then this should not be treated as a valid connection:</p>
<pre><code>{ _id: 1, name: &quot;1&quot;, connectsTo: null }
{ _id: 2, name: &quot;2&quot;, connectsTo: &quot;1&quot; }
{ _id: 3, name: &quot;3&quot;, connectsTo: &quot;2&quot; }
{ _id: 4, name: null, connectsTo: &quot;3&quot; }
{ _id: 5, name: null, connectsTo: &quot;3&quot; }
{ _id: 6, name: &quot;6&quot;, connectsTo: null }
{ _id: 7, name: null, connectsTo: &quot;6&quot; }
</code></pre>
<p>So the graph looks like this:</p>
<pre><code>1 &lt;- 2 &lt;- 3 &lt;- 4
            &lt;- 5
6 &lt;- 7
</code></pre>
<p>4, 5 and 7 all have null names</p>
<p>I want to get the hierarchy of nodes, from 1 and exclude any nodes disconnected from 1.</p>
<p>I've tried this query:</p>
<pre><code>db.nodes.aggregate([
  { $match: { _id: 1 } },
  { $graphLookup: {
      from: &quot;nodes&quot;,
      startWith: &quot;$name&quot;,
      connectFromField: &quot;name&quot;,
      connectToField: &quot;connectsTo&quot;,
      as: &quot;hierarchy&quot;,
      depthField: &quot;depth&quot;
  }}
]).pretty()
</code></pre>
<p>However, this gives the following result:</p>
<pre><code>{
    &quot;_id&quot; : 1,
    &quot;name&quot; : &quot;1&quot;,
    &quot;connectsTo&quot; : null,
    &quot;hierarchy&quot; : [
        { &quot;_id&quot; : 7, &quot;name&quot; : null, &quot;connectsTo&quot; : &quot;6&quot;,  &quot;depth&quot; : NumberLong(4) },
        { &quot;_id&quot; : 1, &quot;name&quot; : &quot;1&quot;,  &quot;connectsTo&quot; : null, &quot;depth&quot; : NumberLong(3) },
        { &quot;_id&quot; : 6, &quot;name&quot; : &quot;6&quot;,  &quot;connectsTo&quot; : null, &quot;depth&quot; : NumberLong(3) },
        { &quot;_id&quot; : 5, &quot;name&quot; : null, &quot;connectsTo&quot; : &quot;3&quot;,  &quot;depth&quot; : NumberLong(2) },
        { &quot;_id&quot; : 4, &quot;name&quot; : null, &quot;connectsTo&quot; : &quot;3&quot;,  &quot;depth&quot; : NumberLong(2) },
        { &quot;_id&quot; : 3, &quot;name&quot; : &quot;3&quot;,  &quot;connectsTo&quot; : &quot;2&quot;,  &quot;depth&quot; : NumberLong(1) },
        { &quot;_id&quot; : 2, &quot;name&quot; : &quot;2&quot;,  &quot;connectsTo&quot; : &quot;1&quot;,  &quot;depth&quot; : NumberLong(0) }
    ]
}
</code></pre>
<p>As you can see, both 7 and 6 are present. What I suspect is happening is that the null connectsTo of 6 is getting matched against the null name of either 4 or 5.</p>
<p>How can I terminate the hierarchy immediately after nodes with a name of null?</p>

