Differences between weekNumber in Mongo and Luxon<p>I am doing some mongo aggregations on dates and have run in to an interesting problem, namely that the $week returned from mongo is different than the weekNumber returned from Luxon.</p>
<p>In the below code snippets, the $week from mongo returns 47, whereas the weekNumber from Luxon returns 48.</p>
<p>Is there a way to normalize the two so that a given date will return the same $week/weekNumber?</p>
<p>I can subtract one from the value returned by Luxon, but I'd like to understand why the responses are different in order to determine if there is a more appropriate/elegant way to fix this.</p>
<p><strong>MONGO</strong>:</p>
<pre><code>[{
    '$match': {
        'date': {
            '$eq': datetime(2020, 11, 23, 0, 0, 0, tzinfo=timezone.utc)
          }
        }
    }, {
    '$project': {
        'w': {
            '$week': '$date'
        }
    }
}]
</code></pre>
<p><strong>LUXON</strong>:</p>
<pre><code>import { DateTime } from &quot;luxon&quot;;

var week = DateTime.fromJSDate(new Date(2020,10,23)).weekNumber;
console.log(week);
</code></pre>

