MongooseJS - Insert Subdocument without Validation on Document<p>I am using Mongoose with Javascript (NodeJS) to read/write to MongoDB. I have a Document (<em>Parent</em>) that has a bunch of Subdocuments (<em>Children</em>) in it. Both my Document and Subdocuments have validation (<code>required: true</code> and a function that validates that the user puts text in the field) defined in their Model.</p>
<p>When attempting to push a new Subdocument into the database, Mongoose rejects my push because validation fails on the Document. This has perplexed me as I am not trying to create a new Document with Subdocument, I am simply trying to push a new Subdocument into an existing Document.</p>
<p>Here is my (example) Mongoose Model:</p>
<pre class="lang-js prettyprint-override"><code>const mongoose = require('mongoose');

const requiredStringValidator = [
  (val) =&gt; {
    const testVal = val.trim();
    return testVal.length &gt; 0;
  },
  // Custom error text
  'Please supply a value for {PATH}',
];
const childrenSchema = new mongoose.Schema({
  childId: {
    type: mongoose.Schema.Types.ObjectId,
  },
  firstName: {
    type: String,
    required: true,
    validate: requiredStringValidator,
  },
  lastName: {
    type: String,
    required: true,
    validate: requiredStringValidator,
  },
  birthday: {
    type: Date,
    required: true,
  },
});
const parentSchema = new mongoose.Schema(
  {
    parentId: {
      type: mongoose.Schema.Types.ObjectId,
    },
    firstName: {
      type: String,
      required: true,
      validate: requiredStringValidator,
    },
    lastName: {
      type: String,
      required: true,
      validate: requiredStringValidator,
    },
    children: [childrenSchema],
  },
  { collection: 'parentsjustdontunderstand' },
);
const mongooseModels = {
  Parent: mongoose.model('Parent', parentSchema),
  Children: mongoose.model('Children', childrenSchema),
};
module.exports = mongooseModels;
</code></pre>
<p>I can successfully push a new <em>Child</em> Subdocument into the <em>Parent</em> Document via the following MongoDB command:</p>
<pre><code>db.parentsjustdontunderstand.update({
    firstName: 'Willard'
}, {
    $push: {
        children: {
    &quot;firstName&quot;: &quot;Will&quot;,
    &quot;lastName&quot;: &quot;Smith&quot;,
    &quot;birthday&quot;: &quot;9/25/1968&quot;        }
    }
});
</code></pre>
<p>However, when I follow the Mongoose documentation <a href="https://mongoosejs.com/docs/subdocs.html#adding-subdocs-to-arrays" rel="nofollow noreferrer">Adding Subdocs to Arrays</a> and try to add it via Mongoose, it fails.</p>
<p>For testing purposes, I am using Postman and performing a PUT request against an endpoint.
The following is <code>req.body</code>:</p>
<pre class="lang-json prettyprint-override"><code>{
    &quot;firstName&quot;: &quot;Will&quot;,
    &quot;lastName&quot;: &quot;Smith&quot;,
    &quot;birthday&quot;: &quot;9/25/1968&quot;
}
</code></pre>
<p>My code is:</p>
<pre class="lang-js prettyprint-override"><code>const { Parent } = require('parentsModel');
const parent = new Parent();
parent.children.push(req.body);
parent.save();
</code></pre>
<p>What I get back is:</p>
<pre><code>ValidationError: Parent validation failed: firstName: Path `firstName` is required...`
</code></pre>
<p>and it lists all of the <em>Parent</em> Document's validation requirements.</p>
<p>I could use some help on what I am doing wrong. For the record, I have looked at this answer on Stackoverflow: <a href="https://stackoverflow.com/questions/33049707/push-items-into-mongo-array-via-mongoose">Push items into mongo array via mongoose</a> but most examples I see do not show or discuss validation in their Mongoose Models.</p>
<p><strong>EDIT 1</strong></p>
<p>Based on feedback from @j-f, I modified my code to below (moving the body out of <code>req.body</code> and just creating it in code for testing purposes. When I attempt to push the update the way recommended, the record gets inserted, however, I still get a validation error thrown to console:</p>
<pre class="lang-js prettyprint-override"><code>const parent = await Parent.findOne({firstName: 'Willard'});
const child = {
  children: {
      &quot;firstName&quot;: &quot;Will&quot;,
      &quot;lastName&quot;: &quot;Smith&quot;,
      &quot;birthday&quot;: &quot;9/25/1968&quot;
  }
}
parent.children.push(child);
parent.save();
</code></pre>
<pre><code>ValidationError: Parent validation failed: children.12.firstName: Path `firstName` is required., children.12.lastName: Path `lastName` is required., children.12.birthday: Path `birthday` is required.
</code></pre>

