     &lt;td&gt;

     &lt;button type=&quot;button&quot; class=&quot;btn btn-danger&quot;&gt;Remove&lt;/button&gt;

     &lt;/td&gt;

     &lt;/tr&gt;

     {{/each}}

     &lt;/tbody&gt;
</code></pre>
<h2>2)Array of products</h2>
<p><a href="https://i.stack.imgur.com/nLoqv.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/nLoqv.png" alt="Array of products" /></a></p>
