                cart: cartId,
                product: proId,
                user: userId,
                count: count,
                quantity: qty
            },
            method: 'post',
            success: (response) =&gt; {

                document.getElementById(proId).innerHTML = quantity + count
                document.getElementById('total').innerHTML = response.total

            }
        })
    }
</code></pre>
<h2>Note:</h2>
<p>Above code is working fine when the cart page having only one set of product. But, in case of multiple product lists(as you can see in the image given above)it's not working as I expected. In other words, I want to control each product's buttons separately without overriding one another.</p>
